import './App.css'
import './fonts/Magilio.ttf'
import { Container } from 'react-bootstrap'
import background from "./images/background.jpg"
import bg from "./images/bg.jpg"
import logo from "./images/logo.png"

function App() {
  return (
    <div style={{backgroundImage: `url(${background})`}} className="imggg App">
        <div class="spacer"/>
        <Container>
          <img src={logo} class="homelogo spacebelow" alt="logo" />
        </Container>
        <h5 class="moonrising">Portfolio</h5>
        <h1 class="magilio heading">Alejandra Sandoval</h1>
    </div>
  );
}

export default App;
